require 'watir'
class Importer
  ATTRs = 'bds_id item_id title source link category posted_at expired_at posted_by phone email address product_address price area' \
           ' message_type longitude latitude google_map content front_side back_side front_street floor toilet' \
            ' bed_room living_room furniture paper_status on_project investor project_size direction created_at'
  ATTRs = ATTRs.split

  def self.alond
    @browser =  Watir::Browser.new(:chrome)
    # @browser.window.maximize
    @browser.window.resize_to(1360, 768)
    new_items = []
    existing_links = existing_links 'alond', 1.month.ago
    links = get_links('alond')
    # links = get_available_links
    links =  links - existing_links
    puts "#{links.count} are found and processing."
    return
    count = 0
    links.each do |link|
      sleep(rand(1..3))
      @browser.goto link
      attributes = alond_parse_message @browser
      attributes[:source] = 'alond.com.vn'
      attributes[:link] = link
      attributes[:bds_id] = "alond_#{attributes[:item_id]}"
      # attributes[:phone] = get_phone @browser
      attributes[:created_at] = DateTime.now.utc
      new_items << attributes

      if new_items.size == 10
        batch_add_items(new_items)
        puts "Added 10 products"
        count += 10
        new_items = []
      end
    end
    batch_add_items(new_items) if new_items.size > 0
    count += new_items.count
    puts "Added #{count} products totally"

  end

  def self.mbnd
    @browser =  Watir::Browser.new(:chrome)
    # @browser.window.maximize
    @browser.window.resize_to(1360, 768)
    new_items = []
    existing_links = existing_links 'mbnd', 1.month.ago
    links = get_links('mbnd')
    # links = get_available_links
    puts "links: #{links}"
    links =  links - existing_links
    puts "#{links.count} are found and processing."
    count = 0
    links.each do |link|
      sleep(rand(1..3))
      @browser.goto link
      attributes = mbnd_parse_message @browser
      attributes[:source] = 'mbnd.vn'
      attributes[:link] = link
      attributes[:bds_id] = "mbnd_#{attributes[:item_id]}"
      attributes[:phone] = get_phone @browser
      attributes[:created_at] = DateTime.now.utc
      new_items << attributes

      if new_items.size == 10
        batch_add_items(new_items)
        puts "Added 10 products"
        count += 10
        new_items = []
      end
    end
    batch_add_items(new_items) if new_items.size > 0
    count += new_items.count
    puts "Added #{count} products totally"
  end

