  def self.bds
    agent = new_agent
    count = 0
    new_items = []
    existing_links = existing_links 'bds', 1.month.ago
    # begining_links = 'https://m.batdongsan.com.vn https://m.batdongsan.com.vn/nha-dat-ban-ba-ria-vung-tau' \
    #                  'https://m.batdongsan.com.vn/nha-dat-ban-quan-9' \
    # main_page = agent.get("https://m.batdongsan.com.vn/tim-kiem-nha-dat-ban")
    main_page = agent.get("https://m.batdongsan.com.vn")
    # main_page = agent.get("https://m.batdongsan.com.vn/nha-dat-ban-ba-ria-vung-tau")
    # main_page = agent.get("https://m.batdongsan.com.vn/nha-dat-ban-quan-9")

    sleep 1.second
    zone_links = main_page.links_with(href: /nha-dat-ban-/)
    puts "==================got zone links====================="
    zone_links.first(1).each do |z_link|
      zone_page = z_link.click
      sleep 1.second
      area_links = zone_page.links_with(href: /nha-dat-ban-/)
      puts "==================got area links: #{area_links.count}====================="
      area_links.each do |a_link|
        area_page = a_link.click
        sleep 1.second
        products = area_page.css('.s-list li a')
        puts "==================got area page wirh #{products.count} products====================="
        products.each do |product|
          link = product.attributes['href'].value
          page = agent.get(link) if link.present? && !existing_links.include?(link)
          # puts "======No Page #{link} ========" if !page.present?
          next if !page.present?
          sleep(rand(1..3))
          attributes = bds_parse_message(page)
          attributes[:source] = 'bds.com'
          attributes[:link] = link
          attributes[:bds_id] = "bds_#{attributes[:item_id]}"
          attributes[:created_at] = DateTime.now.utc
          new_items << attributes

          if new_items.size == 10
            batch_add_items(new_items)
            count += 10
            new_items = []
          end
        end
      end
    end
    batch_add_items(new_items) if new_items.size > 0
    count += new_items.count
    puts "Added #{count} products"
  end

