  def self.batch_add_items(items)
    cluster =  Cassandra.cluster
    session = cluster.connect('atoz')
    statement =  session.prepare("INSERT INTO bds (#{ATTRs.join(',')}) VALUES (#{('? '*ATTRs.size).split.join(',')})")
    batch = session.batch do |batch|
        items.each do |item|
           batch.add(statement,arguments:
            [
                item[:bds_id],
                item[:item_id],
                item[:title],
                item[:source],
                item[:link],
                item[:category],
                item[:posted_at],
                item[:expired_at],
                item[:posted_by],
                item[:phone],
                item[:email],
                item[:address],
                item[:product_address],
                item[:price],
                item[:area],
                item[:message_type],
                item[:longitude],
                item[:latitude],
                item[:google_map],
                item[:content],
                item[:front_side],
                item[:back_side],
                item[:front_street],
                item[:floor],
                item[:toilet],
                item[:bad_room],
                item[:living_room],
                item[:furniture],
                item[:paper_status],
                item[:on_project],
                item[:investor],
                item[:project_size],
                item[:direction],
                item[:created_at]
            ])
      end
    end
    session.execute(batch)

  end

